import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, GeoJSON, useMap } from 'react-leaflet';
import Papa from 'papaparse';
import FilterPanel from './FilterPanel';

const WorldMap = () => {
  const [geoJsonData, setGeoJsonData] = useState(null);
  const [thyroidCountries, setThyroidCountries] = useState(new Set());
  const [lungCountries, setLungCountries] = useState(new Set());
  const [selectedCountry, setSelectedCountry] = useState('');
  const [dataType, setDataType] = useState('lung');

  const normalizeCountryName = (name) => {
    const countryMap = {
      'usa': 'United States of America',
      'uk': 'United Kingdom',
      'dr congo': 'Dem. Rep. Congo'
    };
    return countryMap[name.toLowerCase().trim()] || name.trim();
  };

  useEffect(() => {
    fetch('/data/custom.geo.json')
      .then(response => response.json())
      .then(data => {
        setGeoJsonData(data);
        console.log('GeoJSON Loaded:', data.features.map(f => f.properties?.name));
      })
      .catch(err => console.error('Error loading GeoJSON:', err));

    fetch('/data/thyroid_cancer_risk_data.csv')
      .then(response => response.text())
      .then(csvText => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            const countries = new Set(results.data.map(row => normalizeCountryName(row.Country)));
            setThyroidCountries(countries);
            console.log('Thyroid CSV Countries:', countries);
          },
        });
      })
      .catch(err => console.error('Error loading Thyroid CSV:', err));

    fetch('/data/lung_cancer_prediction_dataset.csv')
      .then(response => response.text())
      .then(csvText => {
        Papa.parse(csvText, {
          header: true,
          skipEmptyLines: true,
          complete: (results) => {
            const countries = new Set(results.data.map(row => normalizeCountryName(row.Country)));
            setLungCountries(countries);
            console.log('Lung CSV Countries:', countries);
          },
        });
      })
      .catch(err => console.error('Error loading Lung CSV:', err));
  }, []);

  const getCountryStyle = (feature) => {
    const countryName = feature.properties?.name;
    const isThyroid = thyroidCountries.has(countryName);
    const isLung = lungCountries.has(countryName);
    const isSelectable = isThyroid || isLung;

    if (selectedCountry && countryName !== selectedCountry) {
      return { color: '#cccccc', weight: 1, fillColor: '#e0e0e0', fillOpacity: 0.3 };
    }

    if (!isSelectable) {
      return { color: '#888888', weight: 1, fillColor: '#d3d3d3', fillOpacity: 0.3 }; // Non-selectable country
    }

    if (dataType === 'thyroid' && isThyroid) {
      return { color: '#005bff', weight: 1, fillColor: '#a3caff', fillOpacity: 0.5 };
    } else if (dataType === 'lung' && isLung) {
      return { color: '#008000', weight: 1, fillColor: '#90ee90', fillOpacity: 0.5 };
    } else {
      return { color: '#cccccc', weight: 1, fillColor: '#e0e0e0', fillOpacity: 0.3 };
    }
  };

  const onEachCountry = (feature, layer) => {
    const countryName = feature.properties?.name;
    const isThyroid = thyroidCountries.has(countryName);
    const isLung = lungCountries.has(countryName);
    const isSelectable = isThyroid || isLung;

    // Bind country name tooltip
    layer.bindTooltip(countryName, {
        permanent: false,
        direction: 'auto',
        className: 'country-tooltip'
    });

    // Get initial style
    const originalStyle = getCountryStyle(feature);
    layer.setStyle(originalStyle);

    layer.on({
        mouseover: () => {
            if (isSelectable) {
                layer.setStyle({ 
                    weight: 3, 
                    fillOpacity: 0.7, 
                    fillColor: originalStyle.fillColor // Keep the exact original color
                });
            }
        },
        mouseout: () => {
            if (isSelectable) {
                layer.setStyle(originalStyle); // Restore original color
            }
        },
        click: () => {
            if (isSelectable) {
                setSelectedCountry(countryName);
                console.log(`Selected country: ${countryName}`);
            }
        }
    });
};

  return (
    <div>
      <FilterPanel 
        selectedCountry={selectedCountry} 
        setSelectedCountry={setSelectedCountry} 
        dataType={dataType} 
        setDataType={setDataType} 
      />

      <MapContainer
        className="map-container"
        center={[20, 0]}
        zoom={2.5}
        zoomControl={false}
        dragging={false}
        doubleClickZoom={false}
        scrollWheelZoom={false}
        touchZoom={false}
        keyboard={false}
        attributionControl={false}
        worldCopyJump={false}
      >
        <TileLayer
          url="https://stamen-tiles.a.ssl.fastly.net/toner/{z}/{x}/{y}.png"
          attribution='&copy; <a href="https://stamen.com/">Stamen Design</a> &copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a>'
        />

        {geoJsonData && (
          <GeoJSON
            data={geoJsonData}
            style={getCountryStyle}
            onEachFeature={onEachCountry}
          />
        )}

        <MapZoomHandler selectedCountry={selectedCountry} geoJsonData={geoJsonData} />
      </MapContainer>
    </div>
  );
};

const MapZoomHandler = ({ selectedCountry, geoJsonData }) => {
  const map = useMap();

  useEffect(() => {
    // If selectedCountry changes, zoom into the selected country's bounds
    if (map && selectedCountry && geoJsonData) {
      const selectedCountryLayer = geoJsonData.features.find(
        (feature) => feature.properties.name === selectedCountry
      );

      if (selectedCountryLayer) {
        // Create a GeoJSON layer to find the bounds of the selected country
        const geoJsonLayer = L.geoJSON(selectedCountryLayer);

        // Fit map bounds to the country's geometry
        const bounds = geoJsonLayer.getBounds();
        map.fitBounds(bounds);
      }
    }
  }, [map, selectedCountry, geoJsonData]);

  return null;
};

export default WorldMap;
